import React from "react";
import example from "./example";

const Listing = () => {
  return (
    <ul>
      {example.map((item) => (
        // <li>{item.propertyType}</li>
        <li>{item.address}</li>
        // <li>{item.price}</li>
      ))}
    </ul>
  );
};

export default Listing;
